const Filter = () => {
  return (
    <div>
      <button className="btn" id="btn1">All</button>
      <button className="btn" id="btn2">Development</button>
      <button className="btn" id="btn3">Business</button>
      <button className="btn" id="btn4">Design</button>
      <button className="btn" id="btn5">Lifestyle</button>
    </div>
  )
}

export default Filter
